import {change_menu_state} from '../appHeader'
const profile_photo=()=>{
    if (sessionStorage.session){
        let id = JSON.parse(localStorage.getItem('login_data')).user_id
        return id
    }
    else{
        let id = "unknown"
        return id
    }
}
const logout = ()=>{
    if (sessionStorage.session){delete sessionStorage.session}
}

const switch_menu=(switch_type)=>{
    change_menu_state(switch_type)
}



export {profile_photo , switch_menu}
